struct BitReader {
	ifstream in;
	uint64_t nbits = 0, used = 0;
	int byte = -1, idx = 8;
	BitReader(const string& path) {
		in.open(path, ios::binary);
		if (!in) { cerr << "open fail: " << path << "\n"; exit(1); }
		in.read(reinterpret_cast<char*>(&nbits), sizeof(nbits));
		if (!in) { cerr << "bad header\n"; exit(1); }
	}
	inline int read_bit() {
		if (used >= nbits) return -1;
		if (idx >= 8) { byte = in.get(); if (byte == EOF) return -1; idx = 0; }
		int b = (byte >> (7 - idx)) & 1;
		++idx; ++used;
		return b;
	}
};

